- input: "TEXT\x1CC00326835\x1C.TEXT\x1C\x1CF3XA\x1CNo employee of the Committee spent
    more than 25% of his or her time on activities in connection with a Federal election.
    \                                                                              In
    response to your April 11, 2008 notice:   Our report did disclose contributions
    that were received from local campaigns.  2 U.S.C. 441a deals with limits on contributions
    and expenditures and 2 U.S.C. 441a(f) prohibits a committee from knowingly accepting
    a contribution in violation of the limitations imposed.  Our committee did not
    accept any contributions in excess of those limits.  2 U.S.C. 441b deals with
    contributions from labor organizations and corporations and specifically prohibits
    such organizations from making them and a committee from accepting them.  Our
    committee did not accept any such contributions. As a practical matter, Texas
    state law also prohibits candidates from accepting such contributions so there
    should be no reason to assume that any such contributions were made. 11 CFR 102.5(b)
    requires that organizations that are not political committees under the Act keep
    certain records and make them available for inspection by the Commission.  In
    none of these sections is any requirement imposed on our committee to examine,
    inspect, audit, or otherwise determine the compliance with the law of another
    committee. Since no prohibited contributions were received no corrective action
    is warranted. "
